import React from "react"
import styles from "./styles.module.css"
/*
function URLOutput(props) {
    return (
        <div className={styles.item}>
            <h3>Your Minified URL: </h3>
            <p className={styles.urlout}>{ props.newurl } </p>
        </div>
    )
}
*/
class URLOutput extends React.Component {
    state = {
        newURL: (this.props.newurl) ? this.props.newurl: "Generated URL Appears Here"
    }
    render() {
        return (
            <div className={styles.item}>
            <h3>Your Minified URL: </h3>
            <p className={styles.urlout}>{ this.state.newURL } </p>
        </div>
        )
    }
}

export default URLOutput
